// src/components/Projects.js
import React, { useState } from 'react';

const projectsData = [
  {
    title: 'LLM-Powered Customer Support Bot',
    description: 'Reduced response time by 70% and support costs by 40% using fine-tuned LLM',
    tags: ['LLM', 'NLP', 'LangChain'],
    github: '#',
    demo: '#',
    impact: 'ROI: 200% in first year',
    tech: 'Llama2, LangChain, FastAPI'
  },
  {
    title: 'Sentiment Analysis for Social Media',
    description: 'Real-time brand monitoring system processing 100K+ posts daily',
    tags: ['NLP', 'Deep Learning'],
    github: '#',
    demo: '#',
    impact: '95% accuracy, 50ms latency',
    tech: 'BERT, TensorFlow, Docker'
  },
  {
    title: 'Predictive Maintenance System',
    description: 'ML model predicting equipment failures 48h in advance',
    tags: ['ML', 'Time Series'],
    github: '#',
    demo: '#',
    impact: 'Reduced downtime by 60%',
    tech: 'PyTorch, LSTM, AWS'
  },
  {
    title: 'Document Intelligence Platform',
    description: 'Automated extraction of key information from legal documents',
    tags: ['NLP', 'LLM'],
    github: '#',
    demo: '#',
    impact: 'Saved 200+ hours/month',
    tech: 'Hugging Face, Qwen, Flask'
  },
];

const allTags = ['All', ...new Set(projectsData.flatMap(p => p.tags))];

const Projects = () => {
  const [filter, setFilter] = useState('All');

  const filteredProjects =
    filter === 'All'
      ? projectsData
      : projectsData.filter(project => project.tags.includes(filter));

  return (
    <section id="projects" className="py-16 bg-gray-50 dark:bg-gray-800">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-bold text-center mb-4">Featured Projects</h2>
        <p className="text-center text-gray-600 dark:text-gray-300 mb-12">
          Real-world solutions with measurable business impact
        </p>

        {/* Tag Filters */}
        <div className="flex flex-wrap justify-center gap-2 mb-12">
          {allTags.map(tag => (
            <button
              key={tag}
              onClick={() => setFilter(tag)}
              className={`px-4 py-2 rounded-full text-sm font-medium transition ${
                filter === tag
                  ? 'bg-indigo-600 text-white shadow-md'
                  : 'bg-white dark:bg-gray-700 text-gray-700 dark:text-gray-300 hover:bg-gray-100 dark:hover:bg-gray-600'
              }`}
            >
              {tag}
            </button>
          ))}
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
          {filteredProjects.map((project, index) => (
            <div
              key={index}
              className="bg-white dark:bg-gray-700 rounded-xl shadow-lg overflow-hidden hover:shadow-xl transition"
            >
              <div className="p-6">
                <div className="flex justify-between items-start mb-3">
                  <h3 className="text-xl font-bold text-indigo-600 dark:text-indigo-400">
                    {project.title}
                  </h3>
                  <span className="text-xs font-semibold bg-green-100 dark:bg-green-900 text-green-800 dark:text-green-200 px-2 py-1 rounded">
                    {project.impact}
                  </span>
                </div>

                <p className="text-gray-600 dark:text-gray-300 mb-4">
                  {project.description}
                </p>

                <div className="mb-4">
                  <p className="text-sm text-gray-500 dark:text-gray-400">
                    <span className="font-medium">Tech:</span> {project.tech}
                  </p>
                </div>

                <div className="flex flex-wrap gap-2 mb-4">
                  {project.tags.map((tag, i) => (
                    <span
                      key={i}
                      className="text-xs bg-indigo-100 dark:bg-indigo-900 text-indigo-800 dark:text-indigo-200 px-2 py-1 rounded"
                    >
                      {tag}
                    </span>
                  ))}
                </div>

                <div className="flex gap-4">
                  <a
                    href={project.github}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-indigo-600 dark:text-indigo-400 hover:underline font-medium"
                  >
                    GitHub
                  </a>
                  {project.demo && (
                    <a
                      href={project.demo}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-indigo-600 dark:text-indigo-400 hover:underline font-medium"
                    >
                      Demo
                    </a>
                  )}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
